function RethodPE() {
    this._addonManager = new me.astro.utils.AddonManager("com.ljuwon.rethodpe");
    this._addonFreeUrl = "https://github.com/ljuwon321/RethodPE-APK/raw/master/1.0.0.16/RethodPE%20for%20FREE.apk";
    this._addonProUrl = "https://github.com/ljuwon321/RethodPE-APK/raw/master/1.0.0.16/RethodPE%20for%20PRO.apk";
    this._dexUrl = "https://github.com/ljuwon321/RethodPE-APK/raw/master/1.0.0.16/Dex/RethodPEDex.dex";
    this._githubUrl = "https://github.com/ljuwon321/RethodPE-APK";
}

RethodPE.prototype.download = function (isPro) {
    let addonManager = this._addonManager;
    if (isPro) {
        addonManager.download("/sdcard/games/com.mojang/RethodPE.apk", this._addonProUrl, me.astro.utils.AddonManager.DOWNLOAD_ONLY);
    } else {
        addonManager.download("/sdcard/games/com.mojang/RethodPE.apk", this._addonFreeUrl, me.astro.utils.AddonManager.DOWNLOAD_ONLY);
    }
    if (!new java.io.File("/sdcard/games/com.mojang/RethodPEDex.dex").exists()) {
        me.astro.utils.File.download("/sdcard/games/com.mojang/RethodPEDex.dex", this._dexUrl);
    }
};

RethodPE.prototype.setEnabled = function () {
    this._addonManager.setEnabled();
};

RethodPE.prototype.getUrl = function () {
    return this._githubUrl;
};

RethodPE.prototype.install = function () {
    this._addonManager.install("/sdcard/games/com.mojang/RethodPE.apk");
};

RethodPE.prototype.isEnabled = function () {
    return this._addonManager.isEnabled();
};

RethodPE.prototype.isInstalled = function () {
    return this._addonManager.isInstalled();
};

function newLevel() {
    let rethodPE = new RethodPE();
    if (!rethodPE.isEnabled()) {
        let file = new java.io.File("/sdcard/games/com.mojang/RethodPE.apk");
        if (!file.exists()) {
            rethodPE.download(true);
            new java.lang.Thread({
                run() {
                    let file = new java.io.File("/sdcard/games/com.mojang/RethodPE.apk");
                    while (true) {
                        java.lang.Thread.sleep(1000);
                        if (file.exists()) {
                            java.lang.Thread.sleep(3000);
                            rethodPE.install();
                            break;
                        }
                    }
                    while (true) {
                        java.lang.Thread.sleep(1000);
                        if (rethodPE.isInstalled()) {
                            java.lang.Thread.sleep(3000);
                            rethodPE.setEnabled();
                            break;
                        }
                    }
                }
            }).start();
        } else if (!rethodPE.isInstalled()) {
            rethodPE.install();
            new java.lang.Thread({
                run() {
                    while (true) {
                        java.lang.Thread.sleep(1000);
                        if (rethodPE.isInstalled()) {
                            java.lang.Thread.sleep(3000);
                            rethodPE.setEnabled();
                            break;
                        }
                    }
                }
            }).start();
        } else {
            rethodPE.setEnabled();
        }
    }
}